import styled from 'styled-components';
import TitleBanner from '../ui/titleBanner';
import Button from '../ui/button';
import Hours from '../ui/hoursBox';

const Styled = styled.section``;

const About = () => {
  return (
    <Styled>
      <div className='about--content'>
        <TitleBanner
          topTitle='ABOUT US'
          title='welcome'
          botTitle='Good Vibe for Good Day'
        />
        <p className='about--content--text'>
          Simone's is a unique bar and grill located in the Pilsen neighborhood
          of Chicago, Illinois. It's a great place to grab a craft beer,
          cocktail and quality grub. We are also proud to feature local and
          national music talent, gallery and private events.
        </p>
        <Button title='view more' toLink='/about' />
      </div>
      <img src='/GRA_3S.jpg' alt='green restaurant img' />
      <HoursBox />
    </Styled>
  );
};

export default About;
